import React, { useState, createContext } from "react";

export const Context = createContext();

export const ContextProvider = (props) => {
  const [score, setScore] = useState(0);

  const increaseScore = () => {
    setScore((prevScore) => {
      return prevScore + 1;
    });
  };

  return (
    <Context.Provider value={{ score, setScore, increaseScore }}>
      {props.children}
    </Context.Provider>
  );
};
